  client.set(schoolName, value, print);
}

const getAsync = promisify(client.get).bind(client);

async function displaySchoolValue(schoolName) {
  try {
    const res = await getAsync(schoolName);
    console.log(res);
  } catch (error) {
    console.log(error);
    throw error;
  }
}

